import React from 'react'
import "../App.css";
import {BlogContainer, BlogWrapper, BlogTitle, FirstBlog, ImageHolder, BlogText} from './BlogElements'
/* import { Link, Route } from 'react-router-dom' */



function Blog() {
    return (
        <>
        <BlogContainer>
            <BlogWrapper>
                <BlogTitle>Blog page</BlogTitle>
                <FirstBlog>
                    <ImageHolder></ImageHolder>
                    <BlogText>Sponsored by Happy Dog</BlogText>

                </FirstBlog>
            </BlogWrapper>
        </BlogContainer>
        </>
    )
}
export default Blog;
